import React from "react";
import "./css/NotFound.css";
import Logo from "../404.png";

class NotFound extends React.Component {
  render() {
    return (
      <div class="text-middle">
        <img src={Logo} />
        <h1>404</h1>
        <h3>Page Not Found</h3>
      </div>
    );
  }
}

export default NotFound;
